{
  "title": "Access History",
  "type": "area",
  "aggs": [
    {
      "id": "1",
      "enabled": true,
      "type": "count",
      "params": {
        "customLabel": "Access History"
      },
      "schema": "metric"
    },
    {
      "id": "2",
      "enabled": true,
      "type": "date_histogram",
      "params": {
        "field": "@ingestion_timestamp",
        "timeRange": {
          "from": "now-15m",
          "to": "now"
        },
        "useNormalizedOpenSearchInterval": true,
        "scaleMetricValues": false,
        "interval": "auto",
        "drop_partials": false,
        "min_doc_count": 1,
        "extended_bounds": {}
      },
      "schema": "segment"
    }
  ],
  "params": {
    "type": "area",
    "grid": {
      "categoryLines": false
    },
    "categoryAxes": [
      {
        "id": "CategoryAxis-1",
        "type": "category",
        "position": "bottom",
        "show": true,
        "style": {},
        "scale": {
          "type": "linear"
        },
        "labels": {
          "show": true,
          "filter": true,
          "truncate": 100
        },
        "title": {}
      }
    ],
    "valueAxes": [
      {
        "id": "ValueAxis-1",
        "name": "LeftAxis-1",
        "type": "value",
        "position": "left",
        "show": true,
        "style": {},
        "scale": {
          "type": "linear",
          "mode": "normal"
        },
        "labels": {
          "show": true,
          "rotate": 0,
          "filter": false,
          "truncate": 100
        },
        "title": {
          "text": "Access History"
        }
      }
    ],
    "seriesParams": [
      {
        "show": true,
        "type": "histogram",
        "mode": "stacked",
        "data": {
          "label": "Access History",
          "id": "1"
        },
        "drawLinesBetweenPoints": true,
        "lineWidth": 2,
        "showCircles": true,
        "interpolate": "linear",
        "valueAxis": "ValueAxis-1"
      }
    ],
    "addTooltip": true,
    "addLegend": true,
    "legendPosition": "right",
    "times": [],
    "addTimeMarker": false,
    "thresholdLine": {
      "show": false,
      "value": 10,
      "width": 1,
      "style": "full",
      "color": "#E7664C"
    },
    "labels": {}
  }
}

